import React from 'react';
import { StyleSheet, Image, View } from 'react-native';
import Button from '../components/Button';
import Background from '../components/Background';

export default function QuizEndingScreen({ navigation }) {
    return (
        <Background>
            <View style={styles.container}>
                <View style={styles.iconContainer}>
                    <Image source={require('../assets/Vector.png')} style={styles.image} />
                </View>
                <Button
                    color="green"
                    mode="contained"
                    onPress={() => navigation.navigate('Dashboard')}
                >
                    Finish
                </Button>
            </View>
        </Background>
    );
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
    },
    iconContainer: {
        width: 50, // Adjust this size as needed
        height: 50, // Adjust this size as needed
        borderRadius: 25, // Half of the width and height to make it a circle
        backgroundColor: 'yellow', // Adjust the color as needed
        justifyContent: 'center',
        alignItems: 'center',
        marginBottom: 8,
    },
    image: {
        width: 24,
        height: 40,
    },
});
